import React from 'react';
import ReactDOM from 'react-dom/client';

import Header from './common/header/Header'
import Footer from './common/footer/Footer'

import App from './App'

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
      <Header/>
      <App/>
      <Footer/>
  </React.StrictMode>
);
